import React, { useState } from "react";
import { Line } from "react-chartjs-2";
import '../LineChart.css';

function LineChart({ data, lang, translations }) {
  const universities = [...new Set(data.map(row => row.GEO).filter(Boolean))];
  const fields = [...new Set(data.map(row => row["Field of study"]).filter(Boolean))];
  const statuses = [...new Set(data.map(row => row["Registration status"]).filter(Boolean))];
  const years = [...new Set(data.map(row => row.REF_DATE).filter(Boolean))];

  const [selectedUni, setSelectedUni] = useState(universities[0] || "");
  const [selectedField, setSelectedField] = useState(fields[0] || "");
  const [selectedStatus, setSelectedStatus] = useState(statuses[0] || "");
  const [selectedYear, setSelectedYear] = useState("");

  const filtered = data.filter(row =>
    row.GEO === selectedUni &&
    row["Field of study"] === selectedField &&
    row["Registration status"] === selectedStatus &&
    (!selectedYear || row.REF_DATE === selectedYear) &&
    row.VALUE && row.REF_DATE
  );

  const aggregated = {};
  filtered.forEach(row => {
    const year = row.REF_DATE;
    const gender = row.Gender;
    const value = parseInt(row.VALUE) || 0;

    if (!aggregated[gender]) aggregated[gender] = {};
    if (!aggregated[gender][year]) aggregated[gender][year] = 0;
    aggregated[gender][year] += value;
  });

  const sortedYears = [...new Set(filtered.map(row => row.REF_DATE))].sort();

  const chartData = {
    labels: sortedYears,
    datasets: Object.entries(aggregated).map(([gender, values]) => ({
      label: `${translations.lineChart} - ${gender}`,
      data: sortedYears.map(year => values[year] || 0),
      fill: false,
      borderColor: gender === "Man" ? "#3b82f6" : "#ec4899",
      tension: 0.3,
    }))
  };

  return (
    <div className="line-chart-container">
      <h2>{translations.lineChart}</h2>
      <div className="line-chart-filters">
        <div className="dropdown-block">
          <label>{translations.selectUni}</label>
          <select value={selectedUni} onChange={e => setSelectedUni(e.target.value)}>
            {universities.map(u => <option key={u} value={u}>{u}</option>)}
          </select>
        </div>
        <div className="dropdown-block">
          <label>{translations.selectField}</label>
          <select value={selectedField} onChange={e => setSelectedField(e.target.value)}>
            {fields.map(f => <option key={f} value={f}>{f}</option>)}
          </select>
        </div>
        <div className="dropdown-block">
          <label>{translations.selectStatus}</label>
          <select value={selectedStatus} onChange={e => setSelectedStatus(e.target.value)}>
            {statuses.map(s => <option key={s} value={s}>{s}</option>)}
          </select>
        </div>
        <div className="dropdown-block">
          <label>{translations.selectYear}</label>
          <select value={selectedYear} onChange={e => setSelectedYear(e.target.value)}>
            <option value="">All</option>
            {years.map(y => <option key={y} value={y}>{y}</option>)}
          </select>
        </div>
      </div>
      <Line data={chartData} />
    </div>
  );
}

export default LineChart;
